import React from "react";
import MainLayout from "./components/layout/MainLayout";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="overflow-hidden">
        <MainLayout />
      </div>
    </BrowserRouter>
  );
}

export default App;
